import { NavLink } from "react-router-dom";
import {FaShoppingCart } from "react-icons/fa";
import { useSelector } from "react-redux";

const Navbar = () => {
  const{cart}=useSelector((state)=>state)

  return (
    <div className=" bg-green-200 py-4">
      <nav className="max-w-[1080px] flex justify-between mx-auto items-center">
        <NavLink to="/">
          <img src="./shop-logo-cart.png" alt="logoPic" className=" w-[120px] h-[40px]"></img>
        </NavLink>
        <div className="flex gap-4 relative">
          <NavLink to="/">
            <div className="text-xl">Home</div>
          </NavLink>

          <NavLink to="/cart">
            <FaShoppingCart fontSize={25}/>
            <span className="absolute -top-2 right-0 bg-green-300 rounded-full p-">{cart.length}</span>
          </NavLink>

        </div>
      </nav>
    </div>
  )
};

export default Navbar;
